static void re_clear_phy_ups_reg(struct re_softc *sc)
{
        switch(sc->re_type) {
        case MACFG_82:
        case MACFG_83:
        case MACFG_84:
        case MACFG_85:
        case MACFG_86:
        case MACFG_87:
        case MACFG_90:
        case MACFG_91:
        case MACFG_92:
                re_clear_eth_ocp_phy_bit(sc, 0xA466, BIT_0);
        /*	FALLTHROUGH */
        case MACFG_80:
        case MACFG_81:
                re_clear_eth_ocp_phy_bit(sc, 0xA468, BIT_3 | BIT_1);
                break;
        };
}

static int re_is_ups_resume(struct re_softc *sc)
{
        switch(sc->re_type) {
        case MACFG_80:
        case MACFG_81:
        case MACFG_82:
        case MACFG_83:
        case MACFG_84:
        case MACFG_85:
        case MACFG_86:
        case MACFG_87:
        case MACFG_90:
        case MACFG_91:
        case MACFG_92:
                return (re_mac_ocp_read(sc, 0xD42C) & BIT_8);
        default:
                return (re_mac_ocp_read(sc, 0xD408) & BIT_0);
        }
}

static void re_clear_ups_resume_bit(struct re_softc *sc)
{
        switch(sc->re_type) {
        case MACFG_80:
        case MACFG_81:
        case MACFG_82:
        case MACFG_83:
        case MACFG_84:
        case MACFG_85:
        case MACFG_86:
        case MACFG_87:
        case MACFG_90:
        case MACFG_91:
        case MACFG_92:
                re_mac_ocp_write(sc, 0xD42C, re_mac_ocp_read(sc, 0xD42C) & ~(BIT_8));
                break;
        default:
                re_mac_ocp_write(sc, 0xD408, re_mac_ocp_read(sc, 0xD408) & ~(BIT_0));
                break;
        }
}

static u_int8_t re_get_phy_state(struct re_softc *sc)
{
        switch(sc->re_type) {
        case MACFG_80:
        case MACFG_81:
        case MACFG_82:
        case MACFG_83:
        case MACFG_84:
        case MACFG_85:
        case MACFG_86:
        case MACFG_87:
        case MACFG_90:
        case MACFG_91:
        case MACFG_92:
                return (re_real_ocp_phy_read(sc, 0xA420) & 0x7);
        case MACFG_68:
        case MACFG_69:
        case MACFG_70:
        case MACFG_71:
        case MACFG_72:
        case MACFG_73:
        case MACFG_74:
        case MACFG_75:
                return (re_ocp_phy_read(sc, 0x0A42, 0x10) & 0x7);
        default:
                return 0xff;
        };
}

static void re_wait_phy_ups_resume(struct re_softc *sc, u_int16_t PhyState)
{
        switch(sc->re_type) {
        case MACFG_68:
        case MACFG_69:
        case MACFG_70:
        case MACFG_71:
        case MACFG_72:
        case MACFG_73:
        case MACFG_74:
        case MACFG_75:
        case MACFG_80:
        case MACFG_81:
        case MACFG_82:
        case MACFG_83:
        case MACFG_84:
        case MACFG_85:
        case MACFG_86:
        case MACFG_87:
        case MACFG_90:
        case MACFG_91:
        case MACFG_92:
                for (int i=0; i< 100; i++) {
                        if (re_get_phy_state(sc) == PhyState)
                                break;
                        else
                                DELAY(1000);
                }
                break;
        default:
                break;
        };
}

static void re_phy_power_up(device_t dev)
{
        struct re_softc		*sc;
        u_int8_t Data8;

        sc = device_get_softc(dev);

        if ((sc->re_if_flags & RL_FLAG_PHYWAKE_PM) != 0)
                CSR_WRITE_1(sc, RE_PMCH, CSR_READ_1(sc, RE_PMCH) | (BIT_6|BIT_7));

        re_mdio_write(sc, 0x1F, 0x0000);

        switch (sc->re_type) {
        case MACFG_4:
        case MACFG_5:
        case MACFG_6:
        case MACFG_21:
        case MACFG_22:
        case MACFG_23:
        case MACFG_24:
        case MACFG_25:
        case MACFG_26:
        case MACFG_27:
        case MACFG_28:
        case MACFG_31:
        case MACFG_32:
        case MACFG_33:
        case MACFG_63:
        case MACFG_64:
        case MACFG_65:
        case MACFG_66:
                re_mdio_write(sc, 0x0e, 0x0000);
                break;
        case MACFG_56:
        case MACFG_57:
        case MACFG_58:
        case MACFG_61:
                Data8 = re_eri_read(sc, 0x1AB, 1, ERIAR_ExGMAC);
                Data8 |= (BIT_2 | BIT_3 | BIT_4 | BIT_5 | BIT_6 | BIT_7);
                re_eri_write(sc, 0x1AB, 1, Data8, ERIAR_ExGMAC);
                break;
        default:
                break;
        };


        re_mdio_write(sc, MII_BMCR, BMCR_AUTOEN);

        //wait mdc/mdio ready
        switch(sc->re_type) {
        case MACFG_61:
        case MACFG_62:
        case MACFG_67:
                DELAY(10000);
                break;
        }

        //wait ups resume (phy state 3)
        switch(sc->re_type) {
        case MACFG_68:
        case MACFG_69:
        case MACFG_70:
        case MACFG_71:
        case MACFG_72:
        case MACFG_73:
        case MACFG_74:
        case MACFG_75:
        case MACFG_80:
        case MACFG_81:
        case MACFG_82:
        case MACFG_83:
        case MACFG_84:
        case MACFG_85:
        case MACFG_86:
        case MACFG_87:
        case MACFG_90:
        case MACFG_91:
        case MACFG_92:
                re_wait_phy_ups_resume(sc, 3);
                break;
        };
}

static u_int16_t re_get_phy_lp_ability(struct re_softc *sc)
{
        u_int16_t anlpar;

        re_mdio_write(sc, 0x1F, 0x0000);
        anlpar = re_mdio_read(sc, MII_ANLPAR);

        return anlpar;
}

static void re_phy_power_down(device_t dev)
{
        struct re_softc		*sc;
        u_int8_t Data8;

        sc = device_get_softc(dev);

#ifdef ENABLE_FIBER_SUPPORT
        if (HW_FIBER_MODE_ENABLED(sc))
                return;
#endif //ENABLE_FIBER_SUPPORT

        if (sc->re_dash) {
                re_set_wol_linkspeed(sc);
                return;
        }

        re_mdio_write(sc, 0x1F, 0x0000);

        switch (sc->re_type) {
        case MACFG_21:
        case MACFG_22:
        case MACFG_23:
        case MACFG_24:
        case MACFG_25:
        case MACFG_26:
        case MACFG_27:
        case MACFG_28:
        case MACFG_31:
        case MACFG_32:
        case MACFG_33:
        case MACFG_63:
        case MACFG_64:
        case MACFG_65:
        case MACFG_66:
                re_mdio_write(sc, 0x0e, 0x0200);
                re_mdio_write(sc, MII_BMCR, (BMCR_AUTOEN|BMCR_PDOWN));
                break;
        case MACFG_56:
        case MACFG_57:
        case MACFG_58:
        case MACFG_61:
                Data8 = re_eri_read(sc, 0x1AB, 1, ERIAR_ExGMAC);
                Data8 &= ~(BIT_2 | BIT_3 | BIT_4 | BIT_5 | BIT_6 | BIT_7);
                re_eri_write(sc, 0x1AB, 1, Data8, ERIAR_ExGMAC);

                re_mdio_write(sc, MII_BMCR, (BMCR_AUTOEN|BMCR_PDOWN));
                break;
        default:
                re_mdio_write(sc, MII_BMCR, (BMCR_AUTOEN|BMCR_PDOWN));
                break;
        }

        switch (sc->re_type) {
        case MACFG_36:
        case MACFG_37:
        case MACFG_42:
        case MACFG_43:
        case MACFG_54:
        case MACFG_55:
                CSR_WRITE_1(sc, 0xD0, CSR_READ_1(sc, 0xD0) & ~BIT_6);
                break;
        case MACFG_38:
        case MACFG_39:
        case MACFG_50:
        case MACFG_51:
        case MACFG_52:
        case MACFG_56:
        case MACFG_57:
        case MACFG_58:
        case MACFG_59:
        case MACFG_60:
        case MACFG_61:
        case MACFG_62:
        case MACFG_67:
        case MACFG_68:
        case MACFG_69:
        case MACFG_70:
        case MACFG_71:
        case MACFG_72:
        case MACFG_73:
        case MACFG_74:
        case MACFG_75:
                CSR_WRITE_1(sc, 0xD0, CSR_READ_1(sc, 0xD0) & ~BIT_6);
                CSR_WRITE_1(sc, 0xF2, CSR_READ_1(sc, 0xF2) & ~BIT_6);
                break;
        }

        if ((sc->re_if_flags & RL_FLAG_PHYWAKE_PM) != 0)
                CSR_WRITE_1(sc, RE_PMCH, CSR_READ_1(sc, RE_PMCH) & ~(BIT_6|BIT_7));
}

