static void
re_dump_desc(void *desc_base, uint32_t alloc_size)
{
        uint32_t *pdword;
        int i;

        if (desc_base == NULL ||
            alloc_size == 0)
                return;

        pdword = (uint32_t*)desc_base;
        for (i=0; i<(alloc_size/4); i++) {
                if (!(i % 4))
                        printf("\n%04x ", i);
                printf("%08x ", pdword[i]);
        }

        printf("\n");
        return;
}

