                re_real_ocp_phy_write(sc, 0xA438, 0x00FE);
                re_real_ocp_phy_write(sc, 0xA438, 0x00CC);
                re_real_ocp_phy_write(sc, 0xA438, 0x009A);
                re_real_ocp_phy_write(sc, 0xA438, 0x0066);
