                re_real_ocp_phy_write(sc, 0xA438, 0x0000);
                re_real_ocp_phy_write(sc, 0xA438, 0x0000);


                re_set_eth_ocp_phy_bit(sc, 0xA430, BIT_1 | BIT_0);


